function CountrySectionPage(props) {

    useEffect(()=>{
        axios.get("https://newsapi.org/v2/top-headlines?country=SG&apiKey=b085493a09bc48d8869853e6fffd2e9f")
    })





    return (
        <Container>
            <CountrySection country={"SG"} />
            <CountrySection country={"MY"} />
            <CountrySection country={"NG"} />
            <CountrySection country={"SA"} />
        </Container>
    );
}

export default CountrySectionPage;
